import TestimonialSection from '../components/TestimonialSection';


const HomePage = () => {
    return (
        <div>
            <HeroSection />
            <CategoriesSection />
            <FeaturedProducts />
            <TimerSection />

            <TestimonialSection />

        </div>
    );
};

export default HomePage;
